.item1 { grid-area: header;
    display: flex;
    justify-content: space-between;
    background-color: #1abc9c;
    height:80px;
    .head-line{
      display: flex;
      flex-flow: row;;
    }
    .btns{
      display: flex;
      justify-content: space-between;
      width: 9rem;
    }
}
.item2 { grid-area: menu; }
.item3 { grid-area: main;
         display: grid; 
.item4 { grid-area: right; }
.item5 { grid-area: footer; }

.grid-container {
  display: grid;
  grid-template-areas:
    'header header header header header header'
    'menu menu menu menu menu menu'
    'main main main main main main'
    'footer footer footer footer footer footer';
  grid-gap: 10px;
  // background-color: #DAF7A6 ;
  padding: 10px;
}

.header {
  overflow: hidden;
  background-color: #f1f1f1;
  padding: 20px 10px;
}

.header a {
  float: left;
  color: black;
  text-align: center;
  padding: 12px;
  text-decoration: none;
  font-size: 18px; 
  line-height: 25px;
  border-radius: 4px;
}

.header a.logo {
  font-size: 25px;
  font-weight: bold;
}

.header a:hover {
  background-color: #ddd;
  color: black;
}

.header a.active {
  background-color: dodgerblue;
  color: white;
}

.header-right {
  float: right;
}

@media screen and (max-width: 500px) {
  .header a {
    float: none;
    display: block;
    text-align: left;
  }
  
  .header-right {
    float: none;
  }
}

}
